VALUES ('3520991920240', 'Riz Méditerranée de Camargue', 'n 300g 2 poivrons rouges, 3009 •;oog de lotte langoustines, 300g de (décor), un 300g de palourdes, 30(Y; , (250g environ), boite de tomates corve , a paëlla + litres d\'eau, 3 sachets gousses d\'ail + persil, Riz de long étuvé « cuisson » Renouveler l\'opération jusqu\'à la quantit demandée (3 litres). Ajouter les sachets d\'épices à paëlla et laisse mijoter 45 mn environ. Rajouter les langoustine et les gambas, laisser mijoter 5 minutes avant d rajouter les palourdes. Une fois ouvertes, rajoute le riz et décorer avec les moules et les poivrons Laisser cuire le riz pendant 10 minutes. Saupoudrer de l\'ail et du persil. Couvrir et laisser reposer 5 minutes.', 'https://static.openfoodfacts.org/images/products/352/099/192/0240/front_fr.4.400.jpg', '2.1', '0.6', '79', '0.1', '0.9', '6.8', '0.1', '0.0393700787401575', '', '1');

