INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3522030015061', 'Bloc', 'Sucre, pâte de cacao, lait écrémé en poudre, beurre de cacao, maïs (8,5 %), lactosérum er poudre (de lait), beurre concentré, huiles végétales (palme, tournesol), émulsifiant (lécithine de soja), sel, cacao maigre en poudre, arômes, antioxydant (extrait de romarin). Cacao : 33 % minimum dans le chocolat au lait. Peut contenir fruits à coque. A conserver à l\'abri de la chaleur et de l\'humidité. O Melk&tocolade met geroosterde en gezouten mais (11%). Ingrediënten: Suiker, cacaomassa, magere melkpoeder, cacaoboter, maïs (8,5 %), weipoeder (van melk), melkvet, plantaardige oliën (palm, zonnebloem), emulgator (sojalecithine), zout, magere cacaopoeder, aromals, antioxidant (rozemarijnextract). Cacao: ten minste 33 % in de melkchocolade. Kan noten bevatten. Droog en uit de warmte bewaren. Service consommateurs Consumentenservice @ cristal 09.69.39.79.79 Appel non surtaxé www.mondelezinternational.fr @0900-4902902 0,10 EUR/min. www-mondelezinternational.nl', 'https://static.openfoodfacts.org/images/products/352/203/001/5061/front_fr.4.400.jpg', '28', '17', '57', '50', '4', '7.92', '0.51', '0.200787401574803', '', '0');

